import { faPencilAlt } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const FormEditUsuario = () => {
    return (
        <form className="form-group">
            <div className="row">
                <div className="col-12 col-md-6 my-2 d-flex align-items-center">
                    <input type="text" name="nombre" id="nombre" className="form-control mr-auto"/>
                    <FontAwesomeIcon icon={faPencilAlt}/>
                </div>
                <div className="col-12 col-md-6 my-2 d-flex align-items-center">
                    <input type="number" name="telefono" id="telefono" className="form-control mr-auto"/>
                    <FontAwesomeIcon icon={faPencilAlt}/>
                </div>
                <div className="col-12 col-md-6 my-2 d-flex align-items-center">
                    <input type="email" name="email" id="email" className="form-control mr-auto"/>
                    <FontAwesomeIcon icon={faPencilAlt}/>
                </div>
                <div className="col-12 col-md-6 my-2 d-flex align-items-center">
                    <input type="text" name="address" id="address" className="form-control mr-auto"/>
                    <FontAwesomeIcon icon={faPencilAlt}/>
                </div>
            </div>
            <style jsx>{`
                .form-control{
                    width:90%
                }    
            `}</style>
        </form>
    );
}
 
export default FormEditUsuario;
